// src/p2p/discovery.ts
var import_bonjour_service = __toESM(require_dist6(), 1);
var bonjourInstance;
var publishedService;
function startDiscovery(instanceName, portToAnnounce) {
  if (bonjourInstance) {
    console.warn("[Discovery] El descubrimiento ya está iniciado.");
    return;
  }
  bonjourInstance = new import_bonjour_service.Bonjour;
  publishedService = bonjourInstance.publish({
    name: instanceName,
    type: P2P_SERVICE_TYPE,
    protocol: P2P_SERVICE_PROTOCOL,
    port: portToAnnounce,
    txt: {
      id: instanceName,
      timestamp: Date.now().toString()
    }
  });
  console.log(`[Discovery] Servicio publicado: ${instanceName} en puerto ${portToAnnounce}`);
  const browser = bonjourInstance.find({ type: P2P_SERVICE_TYPE, protocol: P2P_SERVICE_PROTOCOL });
  browser.on("up", (service) => {
    if (service.name === instanceName && service.port === portToAnnounce) {
      return;
    }
    peerManager.addPeer(service);
  });
  browser.on("down", (service) => {
    peerManager.removePeer(service);
  });
  console.log(`[Discovery] Buscando servicios '${P2P_SERVICE_TYPE}'...`);
  return publishedService;
}
function stopDiscovery() {
  return new Promise((resolve) => {
    if (!bonjourInstance) {
      bonjourInstance = null;
      return null;
    }
    if (publishedService && typeof publishedService.stop === "function") {
      publishedService.stop(() => {
        console.log("[Discovery] Servicio desanunciado.");
        publishedService = null;
        bonjourInstance?.destroy();
        bonjourInstance = null;
        console.log("[Discovery] Instancia Bonjour destruida.");
        resolve();
      });
    } else if (bonjourInstance) {
      bonjourInstance.destroy();
      bonjourInstance = null;
      console.log("[Discovery] Instancia Bonjour destruida (sin servicio publicado).");
      resolve();
    } else {
      console.log("[Discovery] No hay instancia Bonjour para detener.");
      resolve();
    }
  });
}

// src/p2p/communication.ts
import * as net from "net";
import * as fs from "fs";
import * as path from "path";
import * as os from "os";
var serverClients = new Map;
var outgoingConnections = new Map;
var LOCK_FILE = path.join(os.tmpdir(), "p2p-app.lock");
var PIDFILE = path.join(os.tmpdir(), "p2p-app.pid");
function generateSocketId(socket) {
  return `${socket.remoteAddress}:${socket.remotePort}`;
}
function acquireLock() {
  try {
    const fd = fs.openSync(LOCK_FILE, "wx");
    fs.writeSync(fd, process.pid.toString());
    fs.closeSync(fd);
    process.on("exit", () => {
      try {
        fs.unlinkSync(LOCK_FILE);
      } catch (e) {}
    });
    return true;
  } catch (error) {
    if (error && typeof error === "object" && "code" in error && error.code === "EEXIST") {
      try {
        const pid = parseInt(fs.readFileSync(LOCK_FILE, "utf8").trim());
        process.kill(pid, 0);
        console.log(`[TCP Server] Proceso duplicado detectado (PID: ${pid})`);
        return false;
      } catch {
        fs.unlinkSync(LOCK_FILE);
        return acquireLock();
      }
    }
    throw error;
  }
}
function createPidFile() {
  try {
    if (fs.existsSync(PIDFILE)) {
      const pid = parseInt(fs.readFileSync(PIDFILE, "utf8").trim());
      try {
        process.kill(pid, 0);
        console.log(`[TCP Server] Instancia ya ejecutándose (PID: ${pid})`);
        return false;
      } catch (e) {
        fs.unlinkSync(PIDFILE);
      }
    }
    fs.writeFileSync(PIDFILE, process.pid.toString());
    process.on("exit", () => {
      try {
        fs.unlinkSync(PIDFILE);
      } catch (e) {}
    });
    return true;
  } catch (error) {
    console.error("[TCP Server] Error manejando PID file:", error);
    return true;
  }
}
function checkPortAvailability(port) {
  return new Promise((resolve) => {
    const testServer = net.createServer();
    testServer.listen(port, () => {
      testServer.close(() => resolve(true));
    });
    testServer.on("error", (err) => {
      resolve(err.code !== "EADDRINUSE");
    });
  });
}
function startTcpServer(port, onDataCallback, onClientConnected, onClientDisconnected) {
  return new Promise((resolve, reject) => {
    const server = net.createServer((socket) => {
      const socketId = generateSocketId(socket);
      console.log(`[TCP Server] Cliente conectado: ${socketId}`);
      serverClients.set(socketId, socket);
      onClientConnected?.(socket, socketId);
      let buffer = "";
      socket.on("data", (data) => {
        buffer += data.toString("utf8");
        let delimiterIndex;
        while ((delimiterIndex = buffer.indexOf(P2P_MESSAGE_DELIMITER)) > -1) {
          const jsonString = buffer.substring(0, delimiterIndex);
          buffer = buffer.substring(delimiterIndex + P2P_MESSAGE_DELIMITER.length);
          if (jsonString) {
            try {
              const message = JSON.parse(jsonString);
              onDataCallback(socket, message, socketId);
            } catch (e) {
              console.error(`[TCP Server] Error parseando JSON de ${socketId}:`, e.message);
            }
          }
        }
      });
      socket.on("end", () => {
        console.log(`[TCP Server] Cliente desconectado (end): ${socketId}`);
        serverClients.delete(socketId);
        onClientDisconnected?.(socket, socketId);
      });
      socket.on("error", (err) => console.error(`[TCP Server] Error en socket de ${socketId}:`, err.message));
      socket.on("close", (hadError) => {
        if (serverClients.has(socketId)) {
          serverClients.delete(socketId);
          onClientDisconnected?.(socket, socketId);
        }
      });
    });
    server.listen(port, () => {
      const address = server.address();
      console.log(`[TCP Server] Escuchando en ${address.address}:${address.port}`);
      resolve({ server, port: address.port });
    });
    server.on("error", (err) => reject(err));
  });
}
async function createTcpServer(onDataCallback, onClientConnected, onClientDisconnected, options = {}) {
  const {
    preventDuplicates = true,
    duplicateDetectionMethod = "pidfile",
    specificPort = null
  } = options;
  if (preventDuplicates) {
    let canStart = true;
    if (duplicateDetectionMethod === "lockfile")
      canStart = acquireLock();
    else if (duplicateDetectionMethod === "pidfile")
      canStart = createPidFile();
    else if (duplicateDetectionMethod === "port" && specificPort) {
      canStart = await checkPortAvailability(specificPort);
      if (!canStart) {
        console.log(`[TCP Server] Puerto ${specificPort} en uso - proceso duplicado detectado`);
      }
    }
    if (!canStart)
      return false;
  }
  return startTcpServer(specificPort || 0, onDataCallback, onClientConnected, onClientDisconnected);
}
function connectToPeer(peer) {
  const peerFqdn = peer.fqdn;
  if (outgoingConnections.has(peerFqdn)) {
    const existingSocket = outgoingConnections.get(peerFqdn);
    if (!existingSocket.destroyed) {
      return Promise.resolve(existingSocket);
    }
    outgoingConnections.delete(peerFqdn);
  }
  return new Promise((resolve, reject) => {
    const socket = net.createConnection({ host: peer.host, port: peer.port }, () => {
      console.log(`[TCP Client] Conectado a ${peer.name} (${peerFqdn})`);
      outgoingConnections.set(peerFqdn, socket);
      resolve(socket);
    });
    socket.on("error", (err) => {
      outgoingConnections.delete(peerFqdn);
      reject(err);
    });
    socket.on("close", () => outgoingConnections.delete(peerFqdn));
  });
}
function sendMessage(socket, messageObject) {
  if (!socket || socket.destroyed || !socket.writable) {
    console.error("[TCP] No se puede enviar mensaje: Socket no escribible o destruido.");
    return false;
  }
  try {
    const jsonString = JSON.stringify(messageObject);
    socket.write(jsonString + P2P_MESSAGE_DELIMITER);
    return true;
  } catch (e) {
    console.error("[TCP] Error serializando mensaje:", e);
    return false;
  }
}
function closeAllConnections() {
  console.log("[TCP] Cerrando todas las conexiones...");
  serverClients.forEach((socket) => socket.destroy());
  serverClients.clear();
  outgoingConnections.forEach((socket) => socket.destroy());
  outgoingConnections.clear();
}

// src/p2p/p2pService.ts
class P2PService {
  instanceName;
  constructor() {
    this.instanceName = P2P_INSTANCE_NAME_PREFIX + randomUUID().slice(0, 8);
    console.log(`[P2P] Nombre de esta instancia: ${this.instanceName}`);
  }
  async start() {
    const handleIncomingMessage = (socket, message, socketId) => {
      console.log(`[P2P] Mensaje recibido de ${socketId}:`, message);
      if (message.type === "TIMER_UPDATE") {
        console.log("Procesando actualización de timer desde la red P2P...");
      }
    };
    const tcpServerInfo = await createTcpServer(handleIncomingMessage);
    if (!tcpServerInfo) {
      console.error("[P2P] No se pudo iniciar el servidor TCP. ¿Instancia duplicada?");
    }
    const { port: p2pPort } = tcpServerInfo;
    console.log(`[P2P] Servidor TCP P2P escuchando en el puerto: ${p2pPort}`);
    startDiscovery(this.instanceName, p2pPort);
    this.setupPeerListeners();
  }
  setupPeerListeners() {
    peerManager.on("peerUp", async (peer) => {
      console.log(`[P2P] Peer detectado: ${peer.name}. Intentando conectar...`);
      try {
        const socket = await connectToPeer(peer);
        sendMessage(socket, { type: "GREETING", from: this.instanceName });
      } catch (error) {
        console.error(`[P2P] Fallo al conectar con ${peer.name}:`, error.message);
      }
    });
    peerManager.on("peerDown", (peer) => {
      console.log(`[P2P] Peer desconectado: ${peer.name}`);
    });
  }
  async broadcast(message) {
    console.log("[P2P] Transmitiendo mensaje a todos los peers:", message);
    const peers = peerManager.getAllPeers();
    if (peers.length === 0) {
      console.log("[P2P] No hay peers a los que transmitir.");
      return;
    }
    for (const peer of peers) {
      try {
        const socket = await connectToPeer(peer);
        sendMessage(socket, message);
      } catch (error) {
        console.error(`[P2P] No se pudo enviar mensaje a ${peer.name}:`, error.message);
      }
    }
  }
  getPeers() {
    return peerManager.getAllPeers();
  }
  async stop() {
    console.log("[P2P] Deteniendo el servicio P2P...");
    await stopDiscovery();
    closeAllConnections();
  }
}
var p2pserver = new P2PService;

